print '' print '*** Creating sp_authenticate_user'
GO
CREATE PROCEDURE [dbo].[sp_authenticate_user]
	(
	@Username		varchar(20),
	@PasswordHash	varchar(100)
	)
AS
	BEGIN
		SELECT COUNT(UserID)
		FROM dbo.[User]
		WHERE Username = @Username
		AND PasswordHash = @PasswordHash
	END
GO

print '' print '*** Creating sp_retrieve_user_roles'
GO
CREATE PROCEDURE [dbo].[sp_retrieve_user_roles]
	(
	@UserID		int
	)
AS
	BEGIN
		SELECT [Role].RoleID, RoleName, RoleDescription
		FROM dbo.[UserRole], dbo.[Role]
		WHERE [UserRole].[UserID] = @UserID
		AND [UserRole].[RoleID] = [Role].[RoleID]
	END
GO

print '' print '*** Creating sp_update_passwordHash'
GO
CREATE PROCEDURE [dbo].[sp_update_passwordHash]
	(
	@UserID				[int],
	@OldPasswordHash	[varchar](100),
	@NewPasswordHash	[varchar](100)
	)
AS
	BEGIN
		UPDATE dbo.[User]
			SET PasswordHash = @NewPasswordHash
			WHERE UserID = @UserID
			AND PasswordHash = @OldPasswordHash
		RETURN @@ROWCOUNT
	END
GO

