print '' print '*** Creating sp_retrieve_all_plants'
GO
CREATE PROCEDURE [dbo].[sp_retrieve_all_plants]
	(
	@Active		bit
	)
AS
	BEGIN
		SELECT Plant.PlantID, CommonName, ScientificName, 
				Care, GrowingZoneID, SoilTypeID
		FROM dbo.[Plant],dbo.[GrowingZonePlant],dbo.[PlantSoilType]
		WHERE Active = @Active
		AND [GrowingZonePlant].[PlantID] = [Plant].[PlantID] 
		AND [PlantSoilType].[PlantID] = [Plant].[PlantID]
		ORDER BY [CommonName]
	END
GO

