print '' print '*** Creating sp_update_plant'
GO
CREATE PROCEDURE [dbo].[sp_update_plant]
	(
		@PlantID				[int],
	
		@OldCommonName			[varchar](150), 
		@OldScientificName		[varchar](150), 
		@OldCare 				[varchar](250),

		@NewCommonName			[varchar](150), 
		@NewScientificName		[varchar](150), 
		@NewCare 				[varchar](250) 	
	)
AS
	BEGIN
		UPDATE dbo.[Plant]
		      SET CommonName = @NewCommonName,
				  ScientificName = @NewScientificName,
				  Care = @NewCare
			WHERE CommonName = @OldCommonName
			  AND ScientificName = @OldScientificName
			  AND Care = @OldCare
			  AND PlantID = @PlantID		  			
		RETURN @@ROWCOUNT
	END
GO

print '' print '*** Creating sp_update_soil_type'
GO
CREATE PROCEDURE [dbo].[sp_update_soil_type]
	(
		@PlantID				[int],		
		@OldSoilTypeID			[varchar](20),
		@NewSoilTypeID			[varchar](20)	
	)
AS
	BEGIN	  			
		UPDATE dbo.[PlantSoilType]
			  SET SoilTypeID = @NewSoilTypeID
			WHERE SoilTypeID = @OldSoilTypeID
			  AND PlantID = @PlantID			
		RETURN @@ROWCOUNT
	END
GO

print '' print '*** Creating sp_update_growing_zone'
GO
CREATE PROCEDURE [dbo].[sp_update_growing_zone]
	(
		@PlantID				[int],		
		@OldGrowingZoneID		[varchar](20),
		@NewGrowingZoneID		[varchar](20)	
	)
AS
	BEGIN	  			
		UPDATE dbo.[GrowingZonePlant]
			  SET GrowingZoneID = @NewGrowingZoneID
			WHERE GrowingZoneID = @OldGrowingZoneID
			  AND PlantID = @PlantID			
		RETURN @@ROWCOUNT
	END
GO

print '' print '*** Creating sp_delete_plant'
GO
CREATE PROCEDURE [dbo].[sp_delete_plant]
    (
		@PlantID    [int]     
    )
AS 
BEGIN 
     DELETE [dbo].[Plant]
     FROM   [dbo].[Plant]
     WHERE  PlantID = @PlantID
END
GO

